      SELECT + 40 + - - ( col1 ) + col2 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT + col0 / col2 * - - 10 IN ( + 88 * + col2 * + ( + 40 ) + - col1 + + 93 + + + col1 / + - 73 );
  - name: tab0

outputs:
  - name: q8674.out
    data: |
      140
      168
      71
